class Naveen extends React. Component{
    constructor(props){
        super();
        this.State={
            name:"naveen",
            city:"tadipatri"
        }
    }
    render(){
        return(
            <div>
                {this.State.name}<br></br>
                {this.State.city}
                <br></br>

                <button>udate</button>
            </div>
        )
    }
}
export default Naveen;
